import '../App.css';
import React from 'react';

class WidgetCustomization extends React.Component {
    render() {
        return(
            <div style={{textAlign: 'left'}}>
                <div style={{backgroundColor: '#30363D', padding: '10px', marginBottom: '10px', borderRadius: '7px'}}>
                    <div style={{textAlign: 'left', margin: '0px 10px 10px 0px'}}>
                        <p style={{float: 'left', color: 'white', fontWeight: 'bolder'}}>Font</p>
                    </div>
                    <input type="text" placeholder="City" style={{marginTop: '10px'}}></input>
                </div>
            </div>
        )
    }
}

export default WidgetCustomization;
